import React from 'react';
import FacebookIcon from '@material-ui/icons/FacebookIcon';
import {WhatsAppIcon, MailIcon, TwitterIcon, YouTubeIcon} from '@material-ui/icons';
import './App.css';

const Footer = () => (
    <footer>
    <ul>

    <li><WhatsAppIcon/></li>
    <li><MailIcon/></li>
    <li><TwitterIcon/></li>
    <li><YouTubeIcon/></li>
    </ul>
    </footer> 
)

export default Footer;
